function ImagePopup() {
  return(
    <section className="popup popup-image">
            <figure className="popup-image__container">
                <div className="popup-image__item">
                    <button className="popup__close popup-image__close" type="button"></button>
                    <img src="#" alt="" className="popup-image__img" />
                    <figcaption className="popup-image__title"></figcaption>
                </div>
            </figure>
        </section>
  )
}

export default ImagePopup;
